import React from "react";

export default function NavBar() {
  return (
    <nav className="flex flex-row w-full justify-between">
      <div>logo</div>
      <div>
        <ul className='flex lg:flex-row lg:w-2/4'>
          <li>a</li>
          <li>b</li>
          <li>c</li>
          <li>d</li>
        </ul>
      </div>
    </nav>
  );
}
